    <div id="name" ></div>
    
         <div id="users"></div>
    </div>


     <div id="chat-view"></div>

    <div className="chat-form">
      <form id="form"> 
        <input type="text" id="chat-message"  />
        <button  type="submit">Send message</button>
  
      

      </form>

    </div>

        
          
        
        
      </div>
     
      
    );
  }
 
}

export default Chat;
